from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentences = []
    for triple in triples:
        predicate = triple.predicate
        subject = triple.subject
        object_val = triple.object

        if predicate == "numberOfMembers":
            sentences.append(f"{subject} has {object_val} members.")
        elif predicate == "season":
            sentences.append(f"{subject}'s season is {object_val}.")
        elif predicate == "league":
            sentences.append(f"{subject} plays in the {object_val} league.")
        elif predicate == "manager":
            sentences.append(f"{subject}'s manager is {object_val}.")
        elif predicate == "ground":
            sentences.append(f"{subject}'s ground is {object_val}.")
        elif predicate == "fullName":
            sentences.append(f"{subject}'s full name is {object_val}.")
        elif predicate == "chairman":
            sentences.append(f"{subject}'s chairman is {object_val}.")
        elif predicate == "location":
            sentences.append(f"{subject} is located in {object_val}.")
        elif predicate == "owner":
            sentences.append(f"{subject}'s owner is {object_val}.")
        elif predicate == "nickname":
            sentences.append(f"{subject} is also known as {object_val}.")
        elif predicate == "chairmanTitle":
            sentences.append(f"{subject}'s chairman title is {object_val}.")
        elif predicate == "isPartOf":
            sentences.append(f"{subject} is part of {object_val}.")
        elif predicate == "leader":
            sentences.append(f"{subject}'s leader is {object_val}.")
        elif predicate == "part":
            sentences.append(f"{subject} is a part of {object_val}.")
        elif predicate == "mayor":
            sentences.append(f"{subject}'s mayor is {object_val}.")
        elif predicate == "champions":
            sentences.append(f"{object_val} are the champions of {subject}.")
        elif predicate == "country":
            sentences.append(f"{subject} is in {object_val}.")
        elif predicate == "club":
            sentences.append(f"{subject} plays for {object_val}.")
        elif predicate == "capital":
            sentences.append(f"{object_val} is the capital of {subject}.")
        elif predicate == "currency":
            sentences.append(f"{subject}'s currency is {object_val}.")
        elif predicate == "demonym":
            sentences.append(f"{subject}'s demonym is {object_val}.")
        elif predicate == "language":
            sentences.append(f"{subject}'s language is {object_val}.")
        elif predicate == "leaderParty":
            sentences.append(f"{subject}'s leader party is {object_val}.")
        elif predicate == "officialLanguage":
            sentences.append(f"{subject}'s official language is {object_val}.")
        elif predicate == "birthPlace":
            sentences.append(f"{subject} was born in {object_val}.")
        elif predicate == "youthclub":
            sentences.append(f"{subject}'s youth club is {object_val}.")
        elif predicate == "operator":
            sentences.append(f"{subject} is operated by {object_val}.")
        elif predicate == "tenant":
            sentences.append(f"{subject} is a tenant of {object_val}.")
        elif predicate == "city":
            sentences.append(f"{subject} is in the city of {object_val}.")
        elif predicate == "state":
            sentences.append(f"{subject} is in the state of {object_val}.")
        else:
            sentences.append(f"{subject} {predicate} {object_val}.")

    if len(sentences) == 1:
        return sentences[0]
    elif len(sentences) == 2:
        return f"{sentences[0]} and {sentences[1]}."
    else:
        # Attempt to combine sentences for better flow
        combined_sentence = sentences[0]
        for i in range(1, len(sentences)):
            if "is in" in sentences[i] or "is located in" in sentences[i]:
                combined_sentence += f", which is in {sentences[i].split(' ')[-1]}."
            elif "plays for" in sentences[i]:
                combined_sentence += f" and {sentences[i]}."
            else:
                combined_sentence += f". {sentences[i]}"
        return combined_sentence + "."

